    public static void main(String[] args)
    {
        ArrayList<Integer> runPattern = new ArrayList<>();
        int previous = 0;
        int counter = 0;
        int sum = 0;

        for (int i = 0; i < 100; i++)
        {
            for (int j = 0; j < 100; j++)
            {
                if (pattern[j + i *100] == previous){
                    counter++;
                }
                else {
                    runPattern.add(counter);
                    counter = 1;
                    previous = pattern[j + i * 100];
                }

                if (pattern[j + i * 100] == 1)
                    System.out.print("■");
                else
                    System.out.print("□");

            }
            System.out.println();
        }
        runPattern.add(counter);

        System.out.println("Pattern length before compression " + pattern.length + " bits");
        System.out.print("Pattern length after compression " + runPattern.size() + " long");

    }
